import 'package:ieca_mobile/_import.dart';

class NgHymnsMiasoYaKuPascua {
  static List<HymnsContent> list =[
    HymnsContent(id: 3452, position: 1, content: "Halakana luhande luetu!\nYesu Ua tu tsilako;\nUa tu hele muono ua muiulu,\nMuono ua ku hua cahi.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_58, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3453, content: "— Iya ua tu tsililile?\nYesu K’listu, Muana Njambi\n— Vika Ua tsa?\nKu tu ohiela.\n— Halakana!\nHalakana!\nVantu va vavi ha mavu.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_58, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3454, position: 2, content: "Ikeye uezile ha mavu,\nMuomu Ua tu lemene;\nUa fuetele milonga yetu,\nKu tu nehela muono.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_58, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3455, position: 3, content: "Tuaya, u ka Mu kulahela,\nA ka ku hana vuana;\nVuana vua kama vua muono,\nMuono ua ku hua cahi.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_58, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3456, position: 4, content: "Litavele lizina Liendi,\nU ka tambula muono;\nA ka ku kula ku mulonga,\nMuomu Ua ku tsilako.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_58, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3457, position: 1, content: "Ku kulusu nji mona\nLisima lia muono,\nNdonga ya ku kanguisa\nFume ku Siono.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_59, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3458, content: "Kulusu, kulusu,\nNji ka ku halesa,\nNoho nji ka zolela\nKu huima mu sinia.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_59, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3459, position: 2, content: "Ku kulusu lia Yesu,\nNgozi nja uanene;\nVivi viange via vingi,\nUa vi sambuesele.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_59, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3460, position: 3, content: "Ku kulusu, Kilistu,\nNji ka Ku anuka,\nNa ku kayando Kove\nKa nji ka ivala.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_59, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3461, position: 4, content: "Ku kulusu nji kala\nNa tu kengezieka,\nNoho A ka nji tuala\nKu jela mu sinia.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_59, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3462, position: 1, content: "Kalamba ketu uezile\nMu ku tu ovola,\nTe yetu tu li mu vupi\nUa tu tsililile.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_60, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3463, content: "Kati nji suve kayando\nUa muene mu ku nji tsila,\nKati nji suve ngozi ya Nkuli ya\nvantu.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_60, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3464, position: 2, content: "Hano uendele ngue ngendzi,\nKa va Mu tambuile,\nManinga Endi Ua muania\nMu ku pua inkombelo.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_60, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3465, position: 3, content: "Iya, ngue Muene, a tava\nKu tsila va vapi?\nIya, ngue Muene, a tava\nKu tambula lamba?", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_60, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3466, position: 4, content: "Ngozi ya Tata Kalunga\nI na tu ovola;\nTua zimbalele ku lahe,\nLelo tu novoka.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_60, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3467, position: 1, content: "Muilu Ua humine Muana Kalunga,\nNa vulamba Vuendi vua vu sezele;\nUezile ha mavu ngue ua ku hutua,\nVumoni vua muilu tu ka vu huke.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_61, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3468, position: 2, content: "Muene uetu Yesu Ua muene lamba,\nNguendi na tuzila va li na masua,\nNa vambulu luhua va li na vina,\nMuene indzivo yahi A ci kosemo.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_61, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3469, position: 3, content: "Ua hitile hitile hano hantsi,\nUa va tetelele vaze va hutua,\nNa tupuputua Yendi Ua vemuine,\nNa vaka misongo Ua va hinduile.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_61, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3470, position: 4, content: "Vaka vupi vose Ua va lemene,\nHa cilindakano Ua va tsilaho;\nVa ka Mu lemesa vose vatava,\nMomu Ua tu ovola ngambu ku lamba.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_61, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3471, position: 1, content: "Mu mbumbo va haka\nYesu, Muovole;\nKu-tsa na ci mono,\nNkuli yange.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_62, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3472, content: "Yesu na sanguka ngo,\nVitozi Veni na va hiana,\nNa vu vulu vuangana vua Satana,\nA ku yoya, netu tu suana neni,\nImbenu muaso ou,\nMuovole na sanguka.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_62, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3473, position: 2, content: "Va na ziki livue,\nNguavo a kale;\nNkuma na sanguka,\nNkuli yange.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_62, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3474, position: 3, content: "Ku-tsa ka ci hasa\nKu Mu pandeka;\nMalenge a vatua,\nNkuli yange.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_62, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 3475, position: 1, content: "Ngozi ya kama ya Yesu,\nUa nji tsila ha kulusu,\nKu nji ovola ku ku nonga,\nIya asa ku i tanda?", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_63, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3476, content: "Iya ása ku tanda ngozi?\nIya ása ku tanda ngozi?\nNgozi ya kama ya Muovole\nIya asa ku i tanda?", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_63, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 3477, position: 2, content: "Nganja ya lamba Ua nuine,\nCihiso ca Ua yandele\nHa kulusu mu ku nji ovola,\nIya asa ku li tanda?", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_63, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3478, position: 3, content: "Ku tsopa kua vakua vupi,\nCilindakano ca lamba,\nUa nji yandela linga njovoke,\nIya asa ku i tanda?", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_63, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 3479, position: 4, content: "Muovole uaye uahiko,\nCilemo cove ca hiana.\nKu lova kuaco ka tu ka heta!\nYa kama, ya kama.", hymnsNumber: NgHymnsNumberSeeder.MIASO_YA_KU_PASCUA_63, typeStanza: HymnsContentCode.VERSE),
  ];
}